{"operationName":"Carousels","variables":{"limit":12},"query":"query Carousels($limit: Int) {
  carousels(limit: $limit) {
    ... on CampaignCarousel {
      objectID
      objectType
      object {
        id
        name
        numberID
        rewardName
        thumbnail
        childrenCampaigns {
          id
          type
          __typename
        }
        dao {
          id
          alias
          isVerified
          logo
          name
          __typename
        }
        type
        gamification {
          id
          type
          __typename
        }
        __typename
      }
      __typename
    }
    ... on DaoCarousel {
      objectID
      objectType
      object {
        id
        name
        logo
        alias
        __typename
      }
      __typename
    }
    ... on LinkCarousel {
      objectID
      objectType
      title
      image
      url
      __typename
    }
    __typename
  }
}
"}

{"operationName":"Campaigns","variables":{"input":{"listType":"Trending","credSources":null,"gasTypes":null,"types":null,"chains":null,"isVerified":null,"statuses":null,"spaceCategories":null,"first":20,"after":"-1","searchString":null,"claimableByUser":null},"address":""},"query":"query Campaigns($input: ListCampaignInput!, $address: String!) {
  campaigns(input: $input) {
    pageInfo {
      endCursor
      hasNextPage
      __typename
    }
    list {
      ...CampaignSnap
      isBookmarked(address: $address)
      id
      numberID
      name
      childrenCampaigns {
        id
        type
        __typename
      }
      info
      useCred
      formula
      thumbnail
      gasType
      createdAt
      requirementInfo
      description
      enableWhitelist
      chain
      startTime
      requireEmail
      requireUsername
      endTime
      rewardName
      dao {
        id
        name
        logo
        alias
        isVerified
        __typename
      }
      __typename
    }
    __typename
  }
}

fragment CampaignSnap on Campaign {
  id
  name
  ...CampaignMedia
  dao {
    ...DaoSnap
    __typename
  }
  __typename
}

fragment DaoSnap on DAO {
  id
  name
  logo
  alias
  isVerified
  __typename
}

fragment CampaignMedia on Campaign {
  thumbnail
  rewardName
  type
  gamification {
    id
    type
    __typename
  }
  __typename
}
"}
